package ex_04_Operators;

public class Lab035_Operators_Arithmatic_Operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 20;
		int b = 3;
		float c = 3.0f;
		
		
		System.out.println(a+b); 
		System.out.println(a-b);
		System.out.println(a*b);
		System.out.println(a/b);
		
		System.out.println(a/c);
		System.out.println("a+b");
		System.out.println(a+b);
		

	}

}
